import React from "react";
import "./Mystyles.css";
const Sidebar = () => {
  return (
    <div className="side">
      <div className="headers">Header</div>
      <div className="search">Search</div>
      <div className="conver">Conversion</div>
    </div>
  );
};

export default Sidebar;
